import './MyOwn.css'
export const Certificates = () => {
    const generateRandomValue = () => {
        return Math.floor(Math.random() * 101);
    };

    return (
        <div className={"container"}>
            <div className={"bubbles"}>
                {[...Array(100)].map((_, i) => (
                    <span
                        key={i}
                        style={{ "--top": generateRandomValue(), "--left": generateRandomValue(), "--i": i }}
                    ></span>
                ))}
            </div>
        </div>
    );
};
